import React from 'react';
import {Link} from "react-router-dom";

import './footer.css';

const footer = () => {

    const logo = '../../assets/logo-test.webp';
    const alt_logo = 'Logo Test';

    const goToEmail = () => {
        window.location.href = 'mailto:yourmail@domain.com';
    }

    const callTo = () => {
        window.location.href = 'to(9933524257';
    }

    return (
        <footer>
            <div className="container">
                <div className="footer">
                    <div className="footer__logo">
                        <img src={logo} alt={alt_logo} />
                    </div>
                    <div className="footer__copyright">
                        dd
                    </div>
                    <div className="footer__info">
                        <ul>
                            <li>
                                <Link to="javascript:void(0)" onClick={goToEmail()} rel="nofollow" >atencionaclientes@test.com</Link>
                            </li>
                            <li>
                                <Link to="javascript:void(0)" onClick={callTo()} rel="nofollow">(993) 3524257</Link>
                            </li>
                        </ul>
                    </div>
                </div>
            </div>
        </footer>
    );
};

export default footer;
